window.bookSummaryJSON = "<p>Diamonds are being smuggled on a formidable scale from Africa to America via Britain. 007's assignment is to break the smuggling ring. It's a dangerous mission that takes him to the racecourse and mud-baths of Saratoga Springs, the gaming tables of Las Vegas, the ghost town of Spectreville, and beyond. The Spangled Mob threatens to be too much even for Bond, but help is at hand in the shape of co-conspirator Tiffany Case. </p> <p>This audiobook includes a bonus interview with Damian Lewis. </p> <p>Blackstone Audio, Inc. James Bond and 007 are registered trademarks of Danjaq LLC, used under license by Ian Fleming Publications Ltd</p>"; 
